// https://leetcode.com/problems/minimum-equal-sum-of-two-arrays-after-replacing-zeros/
// Medium

class Solution {
public:
    long long minSum(vector<int>& nums1, vector<int>& nums2) {
        long long sum1 = 0, zeroes1 = 0;
        for (int i = 0; i < nums1.size(); ++i) {
            sum1 += nums1[i];
            zeroes1 += nums1[i] == 0;
        }
        long long sum2 = 0, zeroes2 = 0;
        for (int i = 0; i < nums2.size(); ++i) {
            sum2 += nums2[i];
            zeroes2 += nums2[i] == 0;
        }
        if (sum1+zeroes1 > sum2+zeroes2) {
            // there should be zeroes in nums2 to fill with values to get up to minimun nums1 sum
            return zeroes2 ? sum1+zeroes1 : -1;
        }
        if (sum2+zeroes2 > sum1+zeroes1) {
            // similar to above reasoning
            return zeroes1 ? sum2+zeroes2 : -1;
        }
        return sum2+zeroes2;
    }
};

